void
q2a_interrupts_array_deinit(
    int unit)
{
    soc_interrupt_db_t *q2a_interrupts;
    soc_interrupt_tree_t *q2a_interrupt_tree;
    int inter = 0;
    SHR_FUNC_INIT_VARS(unit);

    
    if (NULL == SOC_CONTROL(unit)->interrupts_info)
    {
        SHR_EXIT();
    }

    q2a_interrupts = SOC_CONTROL(unit)->interrupts_info->interrupt_db_info;
    q2a_interrupt_tree = SOC_CONTROL(unit)->interrupts_info->interrupt_tree_info;

    for (inter = 0; inter < Q2A_INT_LAST; inter++)
    {
        if (q2a_interrupts[inter].statistics_count != NULL)
        {
            sal_free(q2a_interrupts[inter].statistics_count);
            q2a_interrupts[inter].statistics_count = NULL;
        }
        if (q2a_interrupts[inter].storm_nominal_count != NULL)
        {
            sal_free(q2a_interrupts[inter].storm_nominal_count);
            q2a_interrupts[inter].storm_nominal_count = NULL;
        }
        if (q2a_interrupts[inter].storm_detection_occurrences != NULL)
        {
            sal_free(q2a_interrupts[inter].storm_detection_occurrences);
            q2a_interrupts[inter].storm_detection_occurrences = NULL;
        }
        if (q2a_interrupts[inter].storm_detection_start_time != NULL)
        {
            sal_free(q2a_interrupts[inter].storm_detection_start_time);
            q2a_interrupts[inter].storm_detection_start_time = NULL;
        }
    }

    if (q2a_interrupts != NULL)
    {
        sal_free(q2a_interrupts);
        SOC_CONTROL(unit)->interrupts_info->interrupt_db_info = NULL;
    }

    if (q2a_interrupt_tree != NULL)
    {
        sal_free(q2a_interrupt_tree);
        SOC_CONTROL(unit)->interrupts_info->interrupt_tree_info = NULL;
    }

    if (SOC_CONTROL(unit)->interrupts_info != NULL)
    {
        sal_free(SOC_CONTROL(unit)->interrupts_info);
        SOC_CONTROL(unit)->interrupts_info = NULL;
    }

exit:
    SHR_VOID_FUNC_EXIT;
}

